import React from 'react';
import Home from './page/home/Home';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import './App.css';

function App() {
  return (
    <Route>
      <div>
        <Route eact path='/' component={Home} />
      </div>
    </Route>
  );
}

export default App;
